// =============================================================================
/**
 * Derived sampling and checking class used by CHI Link components to 
 * register layer wide checks.
 */
class svt_chi_link_err_check extends svt_err_check;

  /**
    @grouphdr chi_link_err_checks_during_reset Checks during reset
    This group contains checks for signals during reset.
    */
  
  /**
    @grouphdr chi_link_err_x_z_checks X/Z checks
    This group contains X/Z checks for signals.
    */
  
  /**
    @grouphdr chi_link_err_req_vc_msg_field_check REQ VC message field checks
    This group contains checks for request VC message fields.
    */
  
  /**
    @grouphdr chi_link_err_rsp_vc_msg_field_check RSP VC message field checks
    This group contains checks for response VC message fields.
    */
  
  /**
    @grouphdr chi_link_err_snp_vc_msg_field_check SNP VC message field checks
    This group contains checks for snoop VC message fields.
    */
  
  /**
    @grouphdr chi_link_err_dat_vc_msg_field_check DAT VC message field checks
    This group contains checks for data VC message fields.
    */
  
  /**
    @grouphdr chi_link_err_reserved_opcode_check Reserved opcode related checks
    This group contains checks for reserved opcodes.
    */
  
  /**
    @grouphdr chi_link_err_reserved_fields_check Reserved fields related checks
    This group contains checks for reserved fields in a flit.
    */

  
  /**
    @grouphdr chi_link_err_state_transition_check Link active state machine checks
    This group contains checks for state transition.
    */
  
  /**
    @grouphdr chi_sysco_interface_state_transition_check
    This group contains checks for sysco_interface state transition.
    */
  
  /**
    @grouphdr chi_link_err_timeout_check Link active state machine timeout checks
    This group contains checks for timeout.
    */
  
  /**
    @grouphdr chi_link_err_signal_validity_check Signal validity checks
    This group contains checks for signal validity.
    */
  
  /**
    @grouphdr chi_link_err_lcredit_check L-credit related checks
    This group contains checks related to L-credits.
    */
  
  /**
    @grouphdr chi_link_err_link_deactive_check Link deactive mode checks
    This group contains checks when link is not active.
    */

  /**
    @grouphdr chi_link_err_port_interleaving_check Port interleaving checks
    This group contains checks for port interleaving. 
    */



  /** @cond PRIVATE */
  // ****************************************************************************
  // Local Data
  // ****************************************************************************

  /**
   * The group name of the checks defined in this class.
   */
  local string group_name = "link";

  /**
   * The sub-group name of the <specify sub-group purpose> checks defined in this class.
   */
  local string sub_group_name = "";

  /**
   * Controls whether checks are enabled by default
   */
  local bit enable_default_chks;

  local svt_chi_node_configuration node_cfg;

  /** Enables protocol check coverage provided it ll_protocol_checks_coverage_enable is set
  * in the node configuration as well. If enable_pc_cov is 0, then protocol checks coverage
  * will not be enabled, even if it is set in configuration
  */
  local bit enable_pc_cov = 1;
  /** @endcond */

  // ****************************************************************************
  // Public Data Properties
  // ****************************************************************************

  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description   
   * Credits must be available for every transmitted Flit
   * @end_check_description
   *
   * @check_pass
   * Credits are available before flit transfer. 
   * @end_check_pass
   *
   * @check_fail
   * Credits are not available before flit transfer. 
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats tx_no_lcredit_for_flit_transfer;

  /**
   * @groupname chi_link_err_link_deactive_check
   * @check_description   
   * Flits must not be transmitted while the link is not active
   * @end_check_description
   *
   * @check_pass
   * Flits transmitted while the link is active.
   * @end_check_pass
   *
   * @check_fail
   * Flits transmitted while the link is not active.
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and Passive SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats tx_link_not_active_during_flit_transfer;

  /**
   * @groupname chi_link_err_link_deactive_check
   * @check_description   
   * Flits must be observed only when the link is active
   * @end_check_description
   *
   * @check_pass
   * Flits observed while the link is active.
   * @end_check_pass
   *
   * @check_fail
   * Flits observed while the link is not active.
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats rx_link_not_active_during_flit_reception;

  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description   
   * Flits must not be transmitted on the same cycle that a credit is received
   * @end_check_description
   *
   * @check_pass
   * Flits transmitted on the subsequent cycle than that on which the credit is received
   * @end_check_pass
   *
   * @check_fail
   * Flits transmitted on the same cycle that a credit is received
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats tx_lcredit_used_same_cycle_which_recieved;

  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description   
   * - Checks if credits are sent, in a timely manner, by the corresponding active node. 
   * - While the number of available L-Credits is less than the configured number of L-Credits (rx_\*_vc_flit_buffer_size in svt_chi_node_configuration), 
   * an L-Credit should be returned within the clock cycles specified in svt_chi_node_configuration::rx_vc_credit_transmission_timeout.
   * .
   * @end_check_description
   *
   * @check_pass
   * while the number of available L-Credits is less than the configured number of L-Credits (rx_*_vc_flit_buffer_size in svt_chi_node_configuration), 
   * an L-Credit is returned within the clock cycles specified in svt_chi_node_configuration::rx_vc_credit_transmission_timeout.
   * @end_check_pass
   *
   * @check_fail
   * while the number of available L-Credits is less than the configured number of L-Credits (rx_*_vc_flit_buffer_size in svt_chi_node_configuration),
   * no L-Credits are returned within the clock cycles specified in svt_chi_node_configuration::rx_vc_credit_transmission_timeout.
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and Passive SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats rx_no_lcredit_issued_for_flit_type;

  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description   
   * The receiver must not send lcredit in stop and activate state.
   * @end_check_description
   *
   * @check_pass
   * The receiver doeas not send lcredit in stop and activate state.
   * @end_check_pass
   *
   * @check_fail
   * The receiver send lcredit in stop and activate state.
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats invalid_lcredit_check;

`ifdef SVT_CHI_ISSUE_B_ENABLE
  /**
   * @groupname chi_link_err_reserved_fields_check
   * @check_description   
   * Check that reserved fields in a flit must be set to zero as per the CHI specification (Section 13.9 Flit packet definitions).
   * @end_check_description
   *
   * @check_pass
   * The reserved fields in a flit set to zero as per the CHI specification.
   * @end_check_pass
   *
   * @check_fail
   * The reserved fields in a flit set to a non-zero value. 
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * This check is applicable only when SVT_CHI_ISSUE_B_ENABLE macro is defined.
   * @end_check_additional_information    
   */
  svt_err_check_stats illegal_reserved_fields_check;
`endif

  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description   
   * - The minimum number of L-Credits that a receiver can provide is one. The maximum number of L-Credits that a receiver can provide is defined as follows based on vc_id
   *   - RXREQ: svt_chi_node_configuration::rx_req_vc_flit_buffer_size
   *   - RXDAT: svt_chi_node_configuration::rx_dat_vc_flit_buffer_size
   *   - RXRSP: svt_chi_node_configuration::rx_rsp_vc_flit_buffer_size
   *   - RXSNP: svt_chi_node_configuration::rx_snp_vc_flit_buffer_size
   *   .
   * .
   * @end_check_description
   *
   * @check_pass
   * L-credit value falls within the valid range as described above
   * @end_check_pass
   *
   * @check_fail
   * L-credit value falls outside the valid range as described above
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and Passive SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats valid_lcredit_range_check;
  
  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description
   * When Tx is in stop state all the applicable lcredit counters should be 0.
   * The Interconnect should not deassert the TXLINKACTIVEACK signal before it has recieved back all the lcredits.
   * - RN:
   *   - TXREQ VC: svt_chi_link_common::txreq_lcrd_count should be 0.
   *   - TXRSP VC: svt_chi_link_common::txrsp_lcrd_count should be 0.
   *   - TXDAT VC: svt_chi_link_common::txdat_lcrd_count should be 0.
   *   .
   * .
   * - SN:
   *   - TXRSP VC: svt_chi_link_common::txrsp_lcrd_count should be 0.
   *   - TXDAT VC: svt_chi_link_common::txdat_lcrd_count should be 0.
   *   .
   * .
   * @end_check_description
   *
   * @check_pass
   * All the applicable lcredit counters are 0 in tx stop state.
   * @end_check_pass
   *
   * @check_fail
   * All the applicable lcredit counters are non zero in tx stop state.
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats valid_lcredit_count_in_tx_stop_state_check;
  
  /**
   * @groupname chi_link_err_lcredit_check
   * @check_description
   * The reciever must ensure that it has received all the lcredits before moving to the stop state i.e before deasserting the RXLINKACTIVEACK signal.
   * Applicable channels:
   * - RN_I: RXRSP VC and RXDAT VC 
   * - RN_F/RN_D: RXSNP VC, RXRSP VC and RXDAT VC
   * - SN: RXREQ VC and RXDAT VC
   * .
   * @end_check_description
   *
   * @check_pass
   * All the lcredits are reveiced before moving to the stop state.
   * @end_check_pass
   *
   * @check_fail
   * All the lcredits are not reveiced before moving to the stop state.
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information    
   */
  svt_err_check_stats valid_lcredit_count_in_rx_stop_state_check;

  /**
   * @groupname chi_link_err_timeout_check
   * @check_description   
   * Link activation must complete in a timely manner in response to a received request.
   * @end_check_description
   *
   * @check_pass
   * Link goes to activate state in response to activation well within the value specified in svt_chi_node_configuration::tx_link_activation_timeout.
   * @end_check_pass
   *
   * @check_fail
   * If the number of cycles exceeds the value specified in svt_chi_node_configuration::tx_link_activation_timeout,the check errors out.
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and Passive SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * This check uses the value of svt_chi_node_configuration::tx_link_activation_timeout.
   * @end_check_additional_information     
   */
  svt_err_check_stats tx_link_active_request_timeout_check;

  /**
   * @groupname chi_link_err_timeout_check
   * @check_description   
   * Link deactivation must complete in a timely manner in response to a received request.
   * @end_check_description
   *
   * @check_pass
   * Link goes to deactivate state in response to deactivation well within the value specified in svt_chi_node_configuration::tx_link_deactivation_timeout.
   * @end_check_pass
   *
   * @check_fail
   * If the number of cycles exceeds the value specified in svt_chi_node_configuration::tx_link_deactivation_timeout,the check errors out.
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and Passive SN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * This check uses the value of svt_chi_node_configuration::tx_link_deactivation_timeout.
   * @end_check_additional_information     
   */
  svt_err_check_stats tx_link_deactive_request_timeout_check;

  /**
   * @groupname chi_link_err_state_transition_check
   * @check_description   
   * - Illegal transition of the Transmitter Interface State.
   * - This check monitors the TXLINKACTIVEREQ and TXLINKACTIVEACK signals and records
   * illegal state transitions.
   * .
   * @end_check_description
   *
   * @check_pass
   * Valid state transition as per ARM-IHI0050A: 12.5.1 Table 12-2, ARM-IHI0050B: 13.5.1 Table 13-2. 
   * @end_check_pass
   *
   * @check_fail
   * Illegal state transition as per ARM-IHI0050A: 12.5.1 Table 12-2, ARM-IHI0050B: 13.5.1 Table 13-2. 
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * @end_check_additional_information     
   */
  svt_err_check_stats tx_illegal_state_transition;

  /**
   * @groupname chi_link_err_state_transition_check
   * @check_description   
   * - Illegal transition of the Receiver Interface State.
